DROP TABLE IF EXISTS `APS_BLOG`;
CREATE TABLE `APS_BLOG` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `CREATE_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `USER_ID` bigint(20) NOT NULL,
  `DELFLAG` tinyint(1) NOT NULL DEFAULT '0',
  `TITLE` varchar(100) COLLATE utf8_bin NOT NULL,
  `SIMPLE_CONTENT` text COLLATE utf8_bin COMMENT '博客的摘要信息',
  `CONTENT` mediumtext COLLATE utf8_bin COMMENT '博客内容',
  `DEL_TIME` timestamp NULL DEFAULT NULL,
  `LAST_MODIFY_TIME` timestamp NULL DEFAULT NULL COMMENT '上一次修改的时间',
  `VIEW_NUM` int(11) DEFAULT '0',
  `PUBLISH_STATE` tinyint(1) DEFAULT NULL COMMENT '是否已经发布,草稿',
  `VERSION` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '笔记版本',
  `VERSION_ID` bigint(20) DEFAULT NULL,
  `MODIFY_TIMES` tinyint(1) NOT NULL DEFAULT '0',
  `TAGS` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`ID`),
  UNIQUE KEY `ID` (`ID`),
  KEY `USER_ID` (`USER_ID`),
  KEY `VERSION_ID` (`VERSION_ID`),
  KEY `DELFLAG` (`DELFLAG`),
  KEY `CREATE_TIME` (`CREATE_TIME`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='博客主表';

